### Summary of Core Topics and Concepts

#### Software Testing Fundamentals
1. **Functional Requirements**: Specify the expected behaviors and relationships between inputs and outputs of a system.
2. **Coupling Types**:
   - **Parameter Coupling**: Interaction between modules through parameters.
   - **Shared Data Coupling**: Interaction through shared data.
   - **External Device Coupling**: Interaction through external devices.
   - **Message-Passing Interfaces**: Interaction through messages.

#### Partition Testing
1. **Equivalence Class Partitions**: Dividing input data into partitions where each partition is expected to exhibit similar behavior.
2. **Boundary Value Analysis (BVA)**: Testing at the boundaries of input partitions.
   - Example: For a partition \( 45 \leq score \leq 100 \), test cases include 44, 45, 100, and 101.

#### Logical Expressions
1. **Conjunctive Normal Form (CNF)**: Logical expressions in the form of a conjunction of disjunctions.
2. **Disjunctive Normal Form (DNF)**: Logical expressions in the form of a disjunction of conjunctions.
3. **Satisfiability and Tautology**:
   - **Satisfiable**: A logical expression that can be true for some input values.
   - **Tautology**: A logical expression that is always true.

#### Control Flow Graph (CFG)
1. **All-Defs Coverage**: Ensuring that every definition of a variable is covered.
2. **Edge-Pair Coverage**: Ensuring that every pair of edges is covered.
3. **Cyclomatic Complexity**: A measure of the complexity of a program's control flow.
   - Formula: \( V(G) = E - N + 2 \), where \( E \) is the number of edges and \( N \) is the number of nodes.

#### Symbolic Execution
1. **Path Constraints**: Conditions that represent the path taken during symbolic execution.
2. **Symbolic State**: The state of variables at the end of symbolic execution.

#### Test Coverage Criteria
1. **Base Choice Coverage (BCC)**: Ensuring that all base choices are covered.
2. **RACC (Required Active Clause Coverage)**: Ensuring that all required active clauses are covered.
3. **RICC (Required Inactive Clause Coverage)**: Ensuring that all required inactive clauses are covered.

### Equations

#### Cyclomatic Complexity
\[ V(G) = E - N + 2 \]
where \( E \) is the number of edges and \( N \) is the number of nodes in the CFG.

#### Path Constraints
For a given path, the path constraint is the conjunction of conditions along that path.
Example:
\[ (x_0 = y_0) \land (3 \cdot x_0 + 10 < y_0 \cdot y_0) \]

